function test() {
	let data = [];
	for (let obj of Instruments) {
		for (let inst of obj.Instrument) {
			if (inst.hasOwnProperty("pPitchRange") && inst.hasOwnProperty("longName")) {
				const ID = inst["_id"];
				const nameEN = inst.longName;
				const nameENtuning = inst.traitName == undefined ? null : inst.traitName["__text"];
				const nameDE = deTranslations.find((i) => i.comment == `${ID} longName`).translation;
				const family = deFamily.find((f) => f.source.toLowerCase() == inst.family).translation;
				const transposeChromatic = inst.transposeChromatic == undefined ? 0 : Number(inst.transposeChromatic);
				const range = [inst.aPitchRange.split("-").map((d) => Number(d)), inst.pPitchRange.split("-").map((d) => Number(d))];
				let clef = inst.clef;
				if (Array.isArray(clef)) clef = inst.clef[0];
				else if (clef == undefined) clef = inst.concertClef;

				let midiInstrumentIndex = 0;
				if (Array.isArray(inst.Channel)) midiInstrumentIndex = Number(inst.Channel[0].program["_value"]);
				else if (typeof inst.Channel === "object") midiInstrumentIndex = Number(inst.Channel.program["_value"]);

				dataIndex = ocjeneInstruments.data.findIndex((d) => d.nameDE == nameDE);
				// if (dataIndex > -1) {
				// 	const family = ocjeneInstruments.data[dataIndex].family;
				// }
				data.push({ ID, nameEN, nameDE, range, nameENtuning, transposeChromatic, midiInstrumentIndex, family, clef });
			}
		}
	}
	ocjeneInstruments.data = data;
	ocjenePopulateInstruments();
	// console.log(data);
	function downloadJSON(content, fileName) {
		let a = document.createElement("a");
		let file = new Blob([JSON.stringify(content)], { type: "application/json" });
		a.href = URL.createObjectURL(file);
		a.download = fileName;
		a.click();
		a.remove();
	}
	// downloadJSON(data, "data.json");
}

